import React from 'react';
import './Cart.css'

const Cart = ({ cart }) => {
    let total = 0;
    for (const game of cart) {
        total+=game.time
    }
    return (
        <div>
            <h3>Rafiqul Ala Mahid</h3>
            <h4>Developer</h4>
            <p>Favourite Games: </p>
            <p>Cricket, Football, Chess, Tennis</p>
            <h3>Add some break</h3>
            div.cart
                <div>
                    <h3>Games Cost Details</h3>
                    <div className='cart-display'>
                    <h4>Game time</h4>
                    <p>{total}s</p>
                    </div>
                    <div className='cart-display'>
                        <h4>Break time</h4>
                    </div>
                </div>
        </div>
    );
};

export default Cart;
